import logo from './logo.svg';
import './App.css';
import React from 'react';
import 'tachyons';

class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Welcome to React
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn More abour React
          </a>
        </header>
        <footer>
          <p className='tl'>Contact Me</p>
        </footer>
      </div>
    );
  }
};

export default App;
